import React from "react";
import NewTodoForm from "./NewTodoForm.js";
import TodoListItem from "./TodoListItem";
import "./TodoList.css";

const TodoList = ({ todos = [] }) => (
  <div className="list-wrapper">
    <NewTodoForm />
    {todos.map((todo) => (
      <TodoListItem todo={todo} />
    ))}
  </div>
);

export default TodoList;
